node.text:
@moohippomoo that's a valid concern. as of now, no official information has been out about that. if you go on the petition page, the guy who started the page said he has reached out to Minister Ng Eng Hen to ask these questions: whether funpack has been procured? if so, what will happen to it? what will the budget be spent on instead? who is in-charge of making the decision? etc.

he will be posting updates on the petition page.

but regardless of whether the production of the packs have started, it is still an important conversation to have. things are not set in stone. if businesses, citizens & the G all work together to think about how best to proceed with the current situation, it beats having the whole singapore receiving fun packs that they don't want. it is still worth a conversation. it is still worth a fight.
